typedef pair<int64,int> pip;
#define Eo(x) { cerr << #x << " = " << (x) << endl; }

template<typename T>
T gcd(const T& a, const T& b) {
  return a == 0 ? b : gcd(b%a,a);
}

template<typename T>
bool isprime(const T& k){
  for (T i = 2;i*i<=k;i++)if ((k%i)==0) return false;
  return true;
}

template<typename T>
T mabs(const T& x) {
  if (x>=0) return x;
  return -x;
}

int go(pip a, pip b, int z) {
  if (a.first <= z && a.second > z && b.first <= z && b.second > z) {
    return min(a.second,b.second)-max(a.first,b.first);
  }
  return -1;
}

vector<int> primes;
int TEN[10];

vector<int> canbe[10][100000];
int get_k_from_end(int p, int x) {
  return ((p/TEN[x])%10);
}
char isp[1<<20];
int64 res = 0;
int b[10];

void go(int x, int k) {
  if (x==k) {
    res++;
    return;
  }
  for (int i = 0; i < canbe[x][b[x]].size(); i++) {
    int p = canbe[x][b[x]][i];
    bool good = true;
    for (int j = x+1; j < k; j++) {
      int q = get_k_from_end(p,k-1-j);
      if (canbe[x+1][b[j]*10+q].size()==0){
        good = false;
        break;
      }
    }
    if(!good)continue;
    for (int j = x+1; j < k; j++) {
      b[j] = b[j]*10+get_k_from_end(p,k-1-j);
    }
    int old = b[x];
    b[x]=p;
    go(x+1,k);
    b[x] = old;
    for (int j = x+1; j < k; j++) {
      b[j] /= 10;
    }
  }
}

int solve(int n) {
  int k = 0;
  int q = n;
  for (;q;q/=10,k++);
  q = n;
  for (int i = k-1;q;i--,q/=10){
    b[i] = q%10;
  }
  b[0]=n;
  res=0;
  for (int i = 1; i <=k ; i++) {
    for (int j = 0; j < TEN[i]; j++) {
      canbe[i][j].clear();
    }
  }
  for (int i = 1; i <= k; i++) {
    for (int j = 0; j < primes.size() && primes[j]<TEN[k];j++){
      int x = primes[j]/TEN[k-i];
      canbe[i][x].push_back(primes[j]);
    }
  }
  res=0;
  for (int i = 1; i < k; i++) if (canbe[1][b[i]].size()==0) return 0;
  go(1,k);
  return res;
}


